import * as React from 'react';
import { Dropdown } from '../Dropdown';
import './tabs.scss';

type Submenu = {
  title: string;
  submenu?: Submenu;
}[];

type TabsProps = {
  titles: {
    title: string;
    // submenu?: {
    //   title: string;
    // }[];
    submenu?: Submenu;
  };
};

const Tabs: React.FC<TabsProps> = ({ titles }) => {
  return (
    <li className={'tabs-wrapper'}>
      {titles.submenu ? (
        <>
          <button type="button" aria-haspopup="menu">
            {titles.title}{' '}
          </button>
          <Dropdown submenus={titles.submenu} />
        </>
      ) : (
        <a href="/#">{titles.title}</a>
      )}
    </li>
  );
};

export { Tabs };
